import React from "react";
import { FaStarHalfAlt } from "react-icons/fa";

const Rating = ({ value, text }) => {
  return (
    <div>
      <span>
        <FaStarHalfAlt
          className={
            value >= 1
              ? "fas fa-star"
              : value >= 0.5
              ? "fas fa-star-half-alt"
              : "far fa-star"
          }
        />
      </span>
    </div>
  );
};

export default Rating;
